a>&nbsp;<a href="/s/-Mason------------/" target="_blank">Mason</a>&nbsp;<a href="/s/-Gerard------------/" target="_blank">Gerard</a>&nbsp;<a href="/s/-Sanders------------/" target="_blank">Sanders</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----Robert--------/" target="_blank">Robert</a>&nbsp;<a href="/s/-----L.--------/" target="_blank">L.</a>&nbsp;<a href="/s/-----Farber--------/" target="_blank">Farber</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/20/" target="_blank">福利</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E7%BE%8E%E5%9B%BD-----------/" target="_blank">美国</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2002/" target="_blank">2002</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>平时性感美丽、但个性高傲的电视台首席新闻女主播，一向得到万千影迷爱戴但她的秘密性丑闻竟被人偷拍了，还用来做勒索的筹码……</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/62429/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/31077/" data-original="http://cj.subo8988.com:8988/upload/vod/2018-11-18/201811181542531407.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/31077/">玩命剧组之主播惊魂</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E7%8E%8B%E5%B0%8F%E8%99%8E------------/" target="_blank">王小虎</a>&nbsp;<a href="/s/-%E6%A2%85%E9%9B%AA------------/" target="_blank">梅雪</a>&nbsp;<a href="/s/-%E5%AD%99%E5%8D%9A------------/" target="_blank">孙博</a>&nbsp;<a href="/s/-%E7%99%BD%E8%B4%BA%E7%8F%8D------------/" target="_blank">白贺珍</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%9D%8E%E5%BE%B7%E5%A8%81--------/" target="_blank">李德威</a>&nbsp;<a href="/s/-------------/" target="_blank"></a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/10/" target="_blank">恐怖片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2016/" target="_blank">2016</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>有三个青春靓丽的女孩，他们是当下所流行的女主播大军中的一员每日里你侬我侬，虚情假意，和电脑显示屏另一面的陌生人甜言蜜语，期间孕育了多少杀机而全然无知。某天，女孩们受邀参加某个剧组的电影拍摄工作。这是一部恐怖片，又某个张扬跋扈又小气非常的老板投资。导演自负才气，然时运不济，在巧舌如簧的制片人的游说下，</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/31077/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/23815/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2017-07-09/201707091499599870.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">10.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280高清国语中字版</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/23815/">热血女主播</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E4%BB%98%E7%84%B6------------/" target="_blank">付然</a>&nbsp;<a href="/s/-%E4%BB%81%E9%BE%99------------/" target="_blank">仁龙</a>&nbsp;<a href="/s/-%E5%AE%A3%E8%A8%80------------/" target="_blank">宣言</a>&nbsp;<a href="/s/-%E9%A9%AC%E4%B9%A6%E8%89%AF------------/" target="_blank">马书良</a>&nbsp;<a href="/s/-%E7%94%B0%E9%9B%A8------------/" target="_blank">田雨</a>&nbsp;<a href="/s/-%E7%94%B0%E9%9B%A8------------/" target="_blank">田雨</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E7%8E%8B%E6%B5%B7--------/" target="_blank">王海</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/7/" target="_blank">喜剧片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2017/" target="_blank">2017</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>火爆直播界的新晋女网红花爷，人美，个性强。她淋漓尽致地在自己的直播空间向大众传递运动带来的各种魅力。她涉及的运动门类繁多，每一种都能玩得有模有样——篮球、健身、跆拳道、瑜伽、格斗、舞蹈、游泳、跑步、登山、赛车、攀岩……每一次直播都是对自己极限的挑战，这让她的支持者们更是趋之若鹜，蜂拥而来。&nbsp</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/23815/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/13821/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-01-31/201801311517400803.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">6.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280高清国语中字版</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/13821/">我叫麦克峰之疯狂主播</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%B5%B5%E7%86%A0%E6%B4%8B------------/" target="_blank">赵熠洋</a>&nbsp;<a href="/s/-%E7%8E%8B%E9%A6%A8%E7%90%B3------------/" target="_blank">王馨琳</a>&nbsp;<a href="/s/-%E9%87%91%E7%8E%84%E9%9B%A8------------/" target="_blank">金玄雨</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%BC%A0%E5%87%AF--------/" target="_blank">张凯</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/7/" target="_blank">喜剧片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>　　操着一口东北话，立志成为新闻主播的剩男麦克峰机缘巧合下结识了以“元气女侠”著称的网络当红主播黄飞红，麦克峰偶然发现，所有被黄飞红教训的社会坏蛋，都是公司秘密安排的拖儿，黄飞红却被蒙在鼓里，而麦克峰也意外被网红公司签下，势要打造成“毒舌男神”，两人同一直播平台下，黄飞红却被麦克峰转粉无数，收入锐减</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/13821/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/49578/" data-original="http://pic.youku778.com/upload/vod/2019-02-22/15508421528.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">3.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">18</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/49578/">网络小主播第三季</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-Miranda------------/" target="_blank">Miranda</a>&nbsp;<a href="/s/-Cosgrove------------/" target="_blank">Cosgrove</a>&nbsp;<a href="/s/-Jennette------------/" target="_blank">Jennette</a>&nbsp;<a href="/s/-McCurdy------------/" target="_blank">McCurdy</a>&nbsp;<a href="/s/-Nathan------------/" target="_blank">Nathan</a>&nbsp;<a href="/s/-Kress------------/" target="_blank">Kress</a>&nbsp;<a href="/s/-Jerry------------/" target="_blank">Jerry</a>&nbsp;<a href="/s/-Trainor------------/" target="_blank">Trainor</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----Dan--------/" target="_blank">Dan</a>&nbsp;<a href="/s/-----Schneider--------/" target="_blank">Schneider</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-e